  import React, { useEffect, useState } from 'react';
  import { Transition } from '@headlessui/react';
  import EfectoEscritura from './EfectoEscritura';
  import Inicio from './Inicio';
  import Tecnologias from './Tecnologias';
  import Experiencia from './Experiencia';
  import Proyectos from './Proyectos';
import Contacto from './Contacto';

    function Slider() {

      const [seccionAnimacion, setseccionAnimacion] = useState('Inicio');
      const [mostrarPantallaInicial, setMostrarPantallaInicial] = useState(true);

      useEffect(() => {
        const tiempo = setTimeout(() => {
          setMostrarPantallaInicial(false);
        },2250);

        return () => clearInterval(tiempo);
      },[])

      const navegacion = (seccion) => {
        setseccionAnimacion(seccion);
        const elemento = document.getElementById(seccion);
        if(elemento){
          elemento.scrollIntoView({behavior:'smooth'})
        }
      }

      useEffect(()=>{
        const titulos = {
          Inicio : "Inicio",
          Tecnologias : "Tecnología",
          ExperienciayFormacion : "Experiencia y Formación",
          Proyectos : "Proyectos",
          Contacto : "Contacto"
        };
        document.title = titulos[seccionAnimacion];
      },[seccionAnimacion]);

      useEffect(() => {
        // Actualiza la clase de la página actual cuando se cambia seccionAnimacion
        setPaginaActual(seccionAnimacion);
      }, [seccionAnimacion]);

      return (
        <>
          <div className="relative">
            <Transition
              show={mostrarPantallaInicial}
              enter="transition-opacity duration-1000"
              enterFrom="opacity-0"
              enterTo="opacity-100"
              leave="transition-opacity duration-1000"
              leaveFrom="opacity-100"
              leaveTo="opacity-0"
            >
              <div className="fixed inset-0 bg-black flex items-center justify-center text-white text-4xl font-bold z-50">
                <EfectoEscritura />
              </div>
            </Transition>

            <Transition
              show={!mostrarPantallaInicial}
              enter="transition-opacity duration-1000"
              enterFrom="opacity-0"
              enterTo="opacity-100"
              leave="transition-opacity duration-1000"
              leaveFrom="opacity-100"
              leaveTo="opacity-0"
            >
            <nav className="fixed top-0 left-0 right-0 flex justify-center items-center py-4 z-50">
            <div>
                  <button className={`py-5 pl-10 pr-10 px-6 focus:outline-none rounded-full transition duration-300 ease-in-out ${paginaActual === 'Inicio' ? 'bg-gray-200 text-gray-800' : 'bg-white text-black hover:bg-gray-200 hover:text-gray-800'}`} onClick={() => navegacion('Inicio')}>
                    <span className='font-bold'>INICIO</span>
                  </button>
                </div>
                <div>
                  <button className={`py-5 pl-10 pr-10 px-6 focus:outline-none rounded-full ml-4 transition duration-300 ease-in-out ${paginaActual === 'Tecnologias' ? 'bg-gray-200 text-gray-800' : 'bg-white text-black hover:bg-gray-200 hover:text-gray-800'}`} onClick={() => navegacion('Tecnologias')}>
                    <span className='font-bold'>TECNOLOGÍAS</span>
                  </button>
                </div>
                <div>
                  <button className={`py-5 pl-10 pr-10 px-6 focus:outline-none rounded-full ml-4 transition duration-300 ease-in-out ${paginaActual === 'ExperienciayFormacion' ? 'bg-gray-200 text-gray-800' : 'bg-white text-black hover:bg-gray-200 hover:text-gray-800'}`} onClick={() => navegacion('ExperienciayFormacion')}>
                    <span className='font-bold'>EXPERIENCIA Y FORMACIÓN</span>
                  </button>
                </div>
                <div>
                  <button className={`py-5 pl-10 pr-10 px-6 focus:outline-none rounded-full ml-4 transition duration-300 ease-in-out ${paginaActual === 'Proyectos' ? 'bg-gray-200 text-gray-800' : 'bg-white text-black hover:bg-gray-200 hover:text-gray-800'}`} onClick={() => navegacion('Proyectos')}>
                    <span className='font-bold'>PROYECTOS</span>
                  </button>
                </div>
            </nav>

            </Transition>
              
            <Inicio seccionAnimacion={seccionAnimacion} navegacion={navegacion}/>

            <Tecnologias seccionAnimacion={seccionAnimacion}/>

            <Experiencia seccionAnimacion={seccionAnimacion}/>  

            <Proyectos seccionAnimacion={seccionAnimacion}/>

            <Contacto seccionAnimacion={seccionAnimacion}/>
          </div>
        </>
      );
    }

    export default Slider;
